import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import { TriviaCategory } from "./models/TriviaApi";
import { getTriviaApiQuestions } from "./utils/APIFunctions";

const App: React.FC = () => {
  const [questions, setQuestions] = useState(
    getTriviaApiQuestions(10, "Art", "hard")
  );
  // const questions = await getTriviaApiQuestions(10, "Art", "hard");
  console.log("QUESTIONS", questions);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
};

export default App;
